var ef={};ef.utils={};ef.utils.preload={images:[],groups:{},add:function(a,b){var c=null;if(typeof b!="undefined"){if(typeof this.groups[b]=="undefined"){this.groups[b]=[]}c=this.groups[b]}else{c=this.images}if(typeof a=="object"){for(i=0;i<a.length;i++){c.push(a[i])}}else{c.push(a)}},run:function(a){var b=null;var c=new Image;if(typeof a!="undefined"){if(a=="all"){for(var d in this.groups){for(j=0;j<this.groups[d].length;j++){c.src=this.groups[d][j]}}return true}else if(typeof this.groups[a]=="undefined"){return false}b=this.groups[a]}else{b=this.images}for(d=0;d<b.length;d++){c.src=b[d]}return true}}